        if (status >=1)
            setstatus (status -1)
        else
            setstatus (status + 1)
    }


    return (
        <div>

            <div>
            This user is: { status===1 ? 'Online':'Offline' }
            </div>
            <div>
                <button onClick={changestatus}>
                    Change Status
                </button>
            </div>
        </div>
    );
};


